import { Card, CardBody, CardImg, CardTitle } from 'reactstrap';
import React, { Component } from 'react';

import isOnline from 'is-online';

const SAD =
  'data:image/jpeg;base64,';

export default class Online extends Component {
  componentDidMount() {
    this.checkStatus();
  }

  checkStatus() {
    this.setState({ online: isOnline() });
    setTimeout(this.checkStatus.bind(this), 60 * 1000);
  }

  render() {
    if (!this.state) {
      return null;
    }

    if (this.state.online) {
      return null;
    }

    return (
      <Card inverse color="danger">
        <CardImg top width="100%" src={SAD} alt="i cry evertim" />
        <CardBody>
          <CardTitle style={{ textAlign: 'center' }}>I am offline :(</CardTitle>
        </CardBody>
      </Card>
    );
  }
}
